import React from 'react';
import  ReactDOM  from 'react-dom/client';
import './index.css';
import App from './App';


function Garage() {

  const cars = ['Ford', 'BMW', 'Audi'];
  return (
    <>
      <h1>Garage</h1>
      {cars.length > 0 &&
        <h2>
          You have {cars.length} cars in your garage.
        </h2>
      }
    </>
  );
}


const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  // <React.StrictMode>
  //   <App />
  // </React.StrictMode>
  <Garage cars={cars} />

);
